    capacity_users INT
);

CREATE TABLE network_performance_data (
    timestamp TIMESTAMP,
    cell_id INT,
    download_speed FLOAT,
    upload_speed FLOAT
);

CREATE TABLE coverage_data (
    cell_id INT,
    coverage_area FLOAT,
    signal_strength INT
);

CREATE TABLE capacity_data (
    cell_id INT,
    max_users INT,
    data_throughput FLOAT
);

CREATE TABLE Cell_Sites (
   cell_id INT PRIMARY KEY,
   location VARCHAR(255),
   coverage_area FLOAT
);

CREATE TABLE 5G_Coverage (
   location VARCHAR(255),
   coverage_status VARCHAR(50),
   latency_ms INT
);

CREATE TABLE User_Statistics (
   user_id INT,
   cell_id INT,
   signal_strength INT,
   data_usage FLOAT
);

CREATE TABLE Network_Optimization (
   optimization_id INT PRIMARY KEY,
   optimization_type VARCHAR(50),
   description VARCHAR(255)
);
